import React, { useEffect, useState } from "react"

const Button = (props) => {
  const [Click, setClick] = useState(0)

  useEffect(() => {
    document.title = 'You pressed ${Click} times'
  })

  return (
    <button onClick={() => setClick(Click + 1)}>{props.text} {Click}</button>
    )
}

Button.defaultProps = {
  text:"Button"
}
export default Button
